import React, { Component } from 'react';


class Nav extends Component {
    render() { 

        const navStyle = {
            display: 'flex',
            alignItems: 'center',
            minHeight: '130px',
            backgroundColor: '#FFFFFFF',
            color: 'E1C3C7',
            borderBottom: '20px #000000 solid',
            padding: '0px 20px'
        }

        const navItems = {
            listStyleType: 'none',
            fontFamily: 'avenir'
        }

        return(
            <nav style={navStyle}>
                <h3>Affitto</h3>
                <ul style={navItems}>
                    <li>Merchant Portal</li>
                </ul>
            </nav>
        );
    }
}

export default Nav;
